import React from 'react';
import PropTypes from 'prop-types';

const LeadershipCard = ({ role, organization, period, achievements }) => (
  <div className="border border-[#ABB2BF] p-6 hover:border-[#C778DD] transition-colors">
    <h3 className="text-xl font-bold mb-2">{role}</h3>
    <p className="text-[#C778DD] mb-2">{organization}</p>
    <p className="text-[#ABB2BF] text-sm mb-4">{period}</p>
    <ul className="space-y-2">
      {achievements.map((achievement, index) => (
        <li key={index} className="flex items-start gap-2 text-[#ABB2BF]">
          <span className="text-[#C778DD]">â€¢</span>
          <span>{achievement}</span>
        </li>
      ))}
    </ul>
  </div>
);

LeadershipCard.propTypes = {
  role: PropTypes.string.isRequired,
  organization: PropTypes.string.isRequired,
  period: PropTypes.string.isRequired,
  achievements: PropTypes.arrayOf(PropTypes.string).isRequired,
};

const Leadership = () => {
  const experiences = [
    {
      role: "Tech Community Leader",
      organization: "Local Developer Community",
      period: "2023 - Present",
      achievements: [
        "Organized monthly tech meetups with 100+ attendees",
        "Mentored 20+ junior developers",
        "Facilitated workshops on modern web technologies",
        "Built partnerships with local tech companies"
      ]
    },
    {
      role: "Project Team Lead",
      organization: "Open Source Project",
      period: "2022 - 2023",
      achievements: [
        "Led a team of 5 developers",
        "Implemented agile development practices",
        "Increased project contributors by 150%",
        "Improved documentation and onboarding process"
      ]
    },
    {
      role: "Hackathon Organizer",
      organization: "University Tech Club",
      period: "2021 - 2022",
      achievements: [
        "Coordinated 3 successful hackathons",
        "Managed budget and sponsorships",
        "Created inclusive environment for participants",
        "Facilitated judging and awards process"
      ]
    }
  ];

  return (
    <section id="leadership" className="py-20 px-4 md:px-8">
      <div className="max-w-6xl mx-auto">
        <h2 className="text-3xl font-bold mb-8">
          <span className="text-[#C778DD]">#</span>leadership
        </h2>
        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8">
          {experiences.map((exp, index) => (
            <LeadershipCard key={index} {...exp} />
          ))}
        </div>
      </div>
    </section>
  );
};

export default Leadership;
